(1139, 1, 'Spirituální péče a víra pacientů', 3, 3, 'Spirituální péče a víra pacientů', 'Pacient má právo přijímat, kromě zdravotních služeb, i péči duchovní.', NULL, 'Mgr. Lietavová Michaela', 'Rada kvality', 'Bc. Karasová Jana', '2022-02-01', '4', '2024-02-01', NULL, '2022-02-01', 'standardy_akreditacni-spiritualni_pece_a_vira_pacientu-pacient_ma_pravo_prijimat_krome_zdravotnich_sluzeb_i_peci_duchovni-revize-4.pdf', 'akreditacni#3', 'Schváleno', 25, NULL, '2023-04-11 12:15:01', '2023-04-11 12:15:01'),
(1140, 1, 'Ochrana pacienta a jeho majetku', 3, 4, 'Ochrana pacienta a jeho majetku', 'Ochrana objektu a majetku je v KHN zabezpečena kombinací bezpečnostních opatření, kterými jsou fyzická ostraha, mechanické a technické prostředky a režimová opatření.', NULL, 'Bc. Bělica René', 'Rada kvality', 'Mgr. Vajglová Pavlína', '2022-02-01', '3', '2024-02-01', NULL, '2022-02-01', 'standardy_akreditacni-ochrana_pacienta_a_jeho_majetku-ochrana_objektu_a_majetku_je_v_khn_zabezpecena_kombinaci_bezpecnostnich_opatreni_kterymi_jsou_fyzicka_ostraha_mechanicke_a_technicke_prostredky_a_rezimova_opatreni-revize-3.pdf', 'akreditacni#4', 'Schváleno', 25, NULL, '2023-04-11 12:25:42', '2023-04-11 12:25:42'),
(1141, 1, 'Stížnostní agenda', 3, 5, 'Stížnostní agenda', 'Pacienti vědí, že mají právo podávat stížnosti na poskytovanou zdravotní péči, či řešit rozpory  vzniklé v průběhu přijímání k hospitalizaci, léčby či propouštění.', NULL, 'Wojnarová Marcela', 'Rada kvality', 'Wojnarová Marcela', '2022-03-30', '3', '2023-02-01', NULL, '2022-02-01', 'standardy_akreditacni-stiznostni_agenda-pacienti_vedi_ze_maji_pravo_podavat_stiznosti_na_poskytovanou_zdravotni_peci_ci_resit_rozpory__vznikle_v_prubehu_prijimani_k_hospitalizaci_lecby_ci_propousteni-revize-3.pdf', 'akreditacni#5', 'Schváleno', 25, NULL, '2023-04-11 12:31:03', '2023-04-11 12:31:03'),
(1142, 1, 'Rozsah vstupního vyšetření pacienta', 1, 1, 'Rozsah vstupního vyšetření pacienta', 'Každý hospitalizovaný pacient bude mít provedeno a řádně zdokumentováno komplexní vstupní vyšetření a potřebu lékařské a ošetřovatelské péče, nejpozději do 24 hodin po přijetí.', NULL, 'MUDr. Brzeżański Henryk', 'Rada kvality', 'MUDr. Kultan Peter', '2022-02-01', '4', '2024-02-01', NULL, '2022-02-01', 'standardy_akreditacni-rozsah_vstupniho_vysetreni_pacienta-kazdy_hospitalizovany_pacient_bude_mit_provedeno_a_radne_zdokumentovano_komplexni_vstupni_vysetreni_a_potrebu_lekarske_a_osetrovatelske_pece_nejpozdeji_do_24_hodin_po_prijeti-revize-4.pdf', 'akreditacni#1', 'Schváleno', 25, NULL, '2023-04-11 12:40:26', '2023-04-12 14:33:52'),
(1143, 1, 'Při vstupním vyšetření pacientů se posuzuje  jejich výživový stav a schopnost sebeobsluhy  a v případě potřeby se jim zajistí další vyšetření či terapeutická intervence', 4, 2, 'Při vstupním vyšetření pacientů se posuzuje  jejich výživový stav a schopnost sebeobsluhy  a v případě potřeby se jim zajistí další vyšetření či terapeutická intervence', 'Popis', NULL, 'MUDr. Rybarčíková Renáta', 'Rada kvality', 'Mgr. Vajglová Pavlína', '2022-02-01', '3', '2024-02-01', NULL, '2022-02-01', 'standardy_akreditacni-pri_vstupnim_vysetreni_pacientu_se_posuzuje__jejich_vyzivovy_stav_a_schopnost_sebeobsluhy__a_v_pripade_potreby_se_jim_zajisti_dalsi_vysetreni_ci_terapeuticka_intervence-popis-revize-3.pdf', 'akreditacni#2', 'Schváleno', 25, NULL, '2023-04-11 12:46:37', '2023-04-11 12:46:37'),
(1144, 1, 'Intervaly klinických vyšetření pacientů', 4, 3, 'Intervaly klinických vyšetření pacientů', 'Klinická vyšetření pacientů se opakují  v intervalech závisejících na jejich stavu a léčbě;  provádějí je osoby k tomu odborně kompetentní', NULL, 'MUDr. Sukop Roman', 'Rada kvality', 'Mgr. Vajglová Pavlína', '2022-06-08', '5', '2023-05-01', NULL, '2022-05-01', 'standardy_akreditacni-intervaly_klinickych_vysetreni_pacientu-klinicka_vysetreni_pacientu_se_opakuji__v_intervalech_zavisejicich_na_jejich_stavu_a_lecbe__provadeji_je_osoby_k_tomu_odborne_kompetentni-revize-5.pdf', 'akreditacni#3', 'Schváleno', 25, NULL, '2023-04-11 13:36:10', '2023-04-11 13:36:36'),
