INSERT INTO `notifications` (`id`, `user_id`, `type_id`, `title`, `content`, `importance`, `status`, `created_at`, `updated_at`) VALUES
(1, 27, 1, 'Zkouška funkce Požárních sirén a Protipožárních opatření', '<p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; color: rgb(85, 85, 85); font-family: &quot;Roboto Condensed&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">Ve čtvrtek 23.3.2023 v čase mezi 12 - 13 hod., budou probíhat funkční zkoušky Požárních Sirén a Protipožárního větrání a únikových cest&nbsp; (netýká se budovy CPM).</p><p style=\"margin: 15px 0px; color: rgb(85, 85, 85); font-family: &quot;Roboto Condensed&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">Zkoušky koordinace budou probíhat postupně na jednotlivých oddělení dle potřeby, trvání zkoušek vždy cca 5min.&nbsp;</p><div style=\"color: rgb(85, 85, 85); font-family: &quot;Roboto Condensed&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px;\">Děkujeme</p><p style=\"margin: 15px 0px;\">info. údržba Brhel<br>Tel. 603 568 468</p></div>', 'muted', 'Zobrazeno', '2023-03-27 08:06:16', '2023-04-05 09:50:25'),
(2, 27, 8, 'Dočasné uzavření očkovacího centra', 'Z důvodu nezájmu obyvatel o očkování proti onemocnění COVID-19 bylo dnem 16.&nbsp;3.&nbsp;2023 dočasně uzavřeno naše očkovací centrum.', 'blue', 'Zobrazeno', '2023-03-27 08:09:02', '2023-03-30 13:07:55'),
(3, 11, 7, 'Stážisté v KHN', '<table class=\"table table-vcenter hoverTable\" style=\"width: 100%; height: 84px;\">\r\n<tbody>\r\n<tr>\r\n<td>Přeček Jan</td>\r\n<td>interní oddělení</td>\r\n<td>20. 3. - 15. 4. 2023</td>\r\n</tr>\r\n<tr>\r\n<td>Švehlová Monika</td>\r\n<td>interní oddělení, ortopedické oddělení</td>\r\n<td>20. 3. - 12. 5. 2023</td>\r\n</tr>\r\n<tr>\r\n<td>Gore Renáta</td>\r\n<td>\r\nortopedické oddělení / interní oddělení\r\n</td>\r\n<td>\r\n27.3.- 15. 4. 2023 / 16.4.- 18. 5. 2023\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>Pekárková Daniela</td>\r\n<td>OKB</td>\r\n<td>11. 4. - 10. 5. 2023</td>\r\n</tr>\r\n<tr>\r\n<td>Szeruda Tomáš&nbsp;</td>\r\n<td>IT</td>\r\n<td>17. 4. - 28. 4. 2023</td>\r\n</tr>\r\n<tr>\r\n<td>Valíčková Sára</td>\r\n<td>interní oddělení</td>\r\n<td>17. 4. - 17. 5. 2023</td>\r\n</tr>\r\n<tr>\r\n<td>Staněk David</td>\r\n<td>oddělení chirurgie páteře, interní oddělení</td>\r\n<td>17. 4. - 25. 8. 2023</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'muted', 'Zobrazeno', '2023-03-27 08:10:55', '2023-04-05 09:50:34'),
(4, 25, 7, 'Studentky SZŠ Žilina na stáži', '<p><font face=\"Roboto Condensed, Arial, Helvetica, sans-serif\" color=\"#555555\"><span style=\"font-size: 14px; background-color: rgb(255, 255, 255);\">V době od 13. 3. do 24. 3. 2023 budou v pracovní dny v nemocnici stážovat studentky SZŠ Žilina.</span></font><br></p>', 'muted', 'Zobrazeno', '2023-03-27 08:13:16', '2023-04-05 09:50:40'),
(5, 11, 2, 'Omezení provozní doby v Lékárně KHN a.s. (v nemocnici)', '<p>Z důvodu nemoci personálu bude v Lékárně KHN a.s. (v nemocnici) v době&nbsp;od 13. 3. do 15. 3. 2023&nbsp;zkrácena provozní doba, a to:&nbsp;7.00 – 14.00 hod.</p>', 'muted', 'Zobrazeno', '2023-03-27 08:15:19', '2023-04-03 08:33:18');
INSERT INTO `notifications` (`id`, `user_id`, `type_id`, `title`, `content`, `importance`, `status`, `created_at`, `updated_at`) VALUES
(6, 11, 7, 'MDŽ', '<div style=\"color: rgb(85, 85, 85); font-family: &quot;Roboto Condensed&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"><div style=\"text-align: center;\"><span style=\"color: rgb(164, 10, 164); font-size: 24pt;\"><strong>8. březen - Mezinárodní den žen</strong></span></div><p style=\"margin: 15px 0px; text-align: center;\">&nbsp;<span style=\"color: rgb(113, 145, 18); font-size: 14pt;\"><strong>U této příležitosti připravujeme na tento den pro naše zaměstnankyně</strong></span></p><p style=\"margin: 15px 0px; text-align: center;\"><span style=\"color: rgb(113, 145, 18); font-size: 14pt;\"><strong>v&nbsp;konferenčním sále v&nbsp;době od 8&nbsp;do&nbsp;10 hod. malé překvapení.</strong></span></p><p style=\"margin: 15px 0px; text-align: center;\"><span style=\"color: rgb(113, 145, 18); font-size: 14pt;\"><strong>VŠECHNY JSTE SRDEČNĚ ZVÁNY!!!</strong></span></p><p style=\"margin: 15px 0px; text-align: center;\"><img src=\"data:image/png;base64,\" style=\"width: 537.017px; height: 253.362px;\" data-filename=\"kytice-mdz.PNG\"><span style=\"color: rgb(113, 145, 18); font-size: 14pt;\"><strong><br></strong></span></p></div><p></p>', 'muted', 'Zobrazeno', '2023-03-27 08:24:01', '2023-04-03 11:45:50');
INSERT INTO `notifications` (`id`, `user_id`, `type_id`, `title`, `content`, `importance`, `status`, `created_at`, `updated_at`) VALUES
(8, 28, 9, 'Bombastic Party 2023', '<div><img src=\"data:image/png;base64,\" style=\"width: 258.283px; float: right; height: 367.83px;\" data-filename=\"bomba-party-2023.png\" class=\"note-float-right\">Přátelé, kamarádi po téměř tříleté odluce a nuceného covidového mlčení vás RDG oddělení opět zve na tradiční BOOMBASTIC PARTY 2023</div><div><br></div><div><b>dne 28. 4. 2023 od 15:30 hod. do restaurace Tesarčík</b></div><div><b><br></b></div><ul><li>Akce se bude konat v duchu dlouholetých tradic, za doprovodu hudby z produkce DJ Svati</li><li><span style=\"font-size: var(--tblr-body-font-size); font-weight: var(--tblr-body-font-weight); letter-spacing: 0px; text-align: var(--tblr-body-text-align);\">Přátelskou atmosféru dokreslí překvapivý kulturní program</span></li><li>Náboj celému večeru dodá bohatá tombola, kdy každá vstupenka je slosovatelná</li><li>Skvělé založení stolů, teplá večeře a výživný rautík podtrhne gurmánský akcent celé události</li><li>Během celé akce je povolen Dancing, Smiching, Kecing, Drinking a mnoho dalšího</li><li>Celého skvělého společenského maratónu se mohou zúčastnit všichni zaměstnanci nemocnice bez rozdílu: věku, pohlaví, barvy pleti, náboženského a politického vyznání, pracovního zařazenía společenského postavení</li><li>Počet míst je ovšem omezen, proto neváhejte a přijďte si zakoupit vstupenky včas</li></ul><div align=\"left\"><br></div><div align=\"left\">Na Vaši účast se budeme těšit...</div><div align=\"left\">RDG oddělení</div>', 'muted', 'Zobrazeno', '2023-03-27 08:39:49', '2023-04-05 09:42:17');
INSERT INTO `notifications` (`id`, `user_id`, `type_id`, `title`, `content`, `importance`, `status`, `created_at`, `updated_at`) VALUES
(9, 11, 2, 'Uzavření personálního a mzdového oddělení', '<div><span style=\"font-size: 16px;\">Dne 28. 3. 2023 v době od 9:00 do 13:00 hod bude z důvodu online školení personální oddělení uzavřeno.&nbsp;</span></div><div><span style=\"font-weight: var(--tblr-body-font-weight); letter-spacing: 0px; text-align: var(--tblr-body-text-align);\">Děkujeme za pochopení.</span><br></div><div><span style=\"font-weight: var(--tblr-body-font-weight); letter-spacing: 0px; text-align: var(--tblr-body-text-align);\">M. Uvírová</span><br></div>', 'blue', 'Zobrazeno', '2023-03-27 14:34:22', '2023-04-03 08:33:09'),
(10, 11, 7, 'Stážistka v KHN', '<p><b>Staňková Monika<br></b><span style=\"font-size: var(--tblr-body-font-size); font-weight: var(--tblr-body-font-weight); letter-spacing: 0px; text-align: var(--tblr-body-text-align);\">4. - 17. 4. 2023</span><b><br></b></p><ul><li>neurologické oddělení</li><li>oddělení následné péče<span style=\"white-space:pre\">	</span></li></ul>', 'muted', 'Zobrazeno', '2023-03-29 08:00:46', '2023-03-30 12:58:43'),
(11, 11, 8, 'Oznámení OKB', '<p>Zavádíme nové vyšetřovací metody:</p><ul><li>elektroforéza proteinů v séru</li><li>imunofixaci bílkovin séra</li></ul><p><br></p><p>Klasický biochemický odběr do gelové zkumavky se žlutým špuntem a standardní žádanka s požadavkem na provedení ELFO v séru. Nelze vyšetřovat hemolytické vzorky a vzorky plazmy (zelený špunt).</p>', 'blue', 'Zobrazeno', '2023-03-30 12:22:51', '2023-03-30 13:10:35'),
(12, 23, 8, 'Přezouvání vozidel - jaro 2023', '<p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; color: rgb(85, 85, 85); font-family: &quot;Roboto Condensed&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">Vyberte si termín výměny pneumatik na služebním autě vyplněním svého jména v nasledující&nbsp;<a href=\"https://docs.google.com/spreadsheets/d/19Tzhxrq7tVBpZ7LhZ5qEL6ehI3om3q6b/edit#gid=1134062828\" style=\"color: rgb(28, 123, 203); text-decoration: none; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; cursor: pointer; transition: all 0.1s ease-in-out 0s;\">tabulce.</a>&nbsp;</p><p style=\"margin: 15px 0px; color: rgb(85, 85, 85); font-family: &quot;Roboto Condensed&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">Nejzazší terním pro zápis do tabulky je&nbsp;<strong>18.4.2023</strong></p><p style=\"margin: 15px 0px; color: rgb(85, 85, 85); font-family: &quot;Roboto Condensed&quot;, Arial, Helvetica, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(51, 51, 51);\">Upozornění: Tento dokument lze vyplnit pouze na počítači který má přístup k internetu.</span></p>', 'muted', 'Zobrazeno', '2023-04-13 09:55:17', '2023-04-13 09:55:17');
